description:
Questa è la prima storica ricetta fatta da Nicolò, una di quelle che aveva visto fare agli chef famosi. Ora che anche lui è uno di quegli chef, Andrea (a malincuore) ha dovuto riconoscere i meriti dell'amico.

Vuoi imparare a preparare Piatti Stellati e Gourmet come un vero PRO, entra su Acadèmia.tv, la scuola di cucina online più frequentata del web! 

Dai un'occhiata - https://www.academia.tv/

Ingredienti per 2 porzioni
Tempo di preparazione: 30 minuti
Difficoltà: Media
• Petto d’anatra, 1;
• Limone succo, 1;
• Arancia succo, 1;
• Zucchero di canna, 6 cucchiai;
• Salsa di soia, 4 cucchiai;
• Patate, 2;
• Timo, q.b.;
• Olio/Sale/Pepe, q.b.

